def find_primes_between_indices(lst):
    def is_prime(n):
        if n <= 1:
            return False
        elif n == 2:
            return True
        elif n % 2 == 0:
            return False
        else:
            for i in range(3, int(n**0.5) + 1, 2):
                if n % i == 0:
                    return False
            return True

    primes = []
    for i in range(261, 460):
        if i < len(lst) and is_prime(lst[i]):
            primes.append(lst[i])
    return sorted(primes)
